import React from "react";

// const links = [{name:  }, { About }, {}, {}, {}, {}];

function Nav() {
  return (
    <nav>
      <a href="#home">Home</a>
      <a href="#about">About</a>
      <a href="#menu">Menu</a>
      <a href="#reservations">Reservations</a>
      <a href="#orderonline">Order Online</a>
      <a href="#login">Login</a>
    </nav>
  );
}

export default Nav;
